import './Header.css';
import scroll from '../../../images/icons/scroll-to-bottom.svg';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Header() {
  return (
    <div className="header__bg">
      <Container>
        <Row>
          <Col xs={12} lg={6}>
            <h1 className="header__heading heading1">Seamless</h1>
            <button className={`d-none d-md-block button-lg`}>Launching 2022</button>
          </Col>
          <Col xs={12} lg={6}>
            <h1 className="header__heading heading1">An ecosystem of protocols that removes the need for intermediaries.</h1>
            <img src={scroll} alt="Scroll to bottom" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Header;
